 predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"63801","type":"Paragraph"},{"attributes":{},"id":"64101","type":"Selection"},{"attributes":{},"id":"64100","type":"UnionRenderers"},{"attributes":{},"id":"64060","type":"Selection"},{"attributes":{},"id":"64059","type":"UnionRenderers"},{"attributes":{},"id":"64018","type":"UnionRenderers"},{"attributes":{},"id":"63978","type":"Selection"},{"attributes":{},"id":"63937","type":"Selection"},{"attributes":{},"id":"63977","type":"UnionRenderers"},{"attributes":{},"id":"63936","type":"UnionRenderers"},{"attributes":{"children":[[{"id":"63798"},0,0,1,2],[{"id":"63799"},0,2,1,2],[{"id":"63800"},0,4,1,2],[{"id":"57395"},1,0,1,3],[{"id":"57430"},1,3,1,3],[{"id":"57465"},2,0,1,3],[{"id":"57500"},2,3,1,3],[{"id":"57535"},3,0,1,3],[{"id":"57570"},3,3,1,3],[{"id":"57605"},4,0,1,3],[{"id":"57640"},4,3,1,3],[{"id":"57675"},5,0,1,3],[{"id":"57710"},5,3,1,3],[{"id":"63801"},6,0,1,6],[{"id":"57745"},7,0,1,3],[{"id":"57780"},7,3,1,3],[{"id":"57815"},8,0,1,3],[{"id":"57850"},8,3,1,3],[{"id":"57885"},9,0,1,3],[{"id":"57920"},9,3,1,3],[{"id":"57955"},10,0,1,3],[{"id":"57990"},10,3,1,3],[{"id":"58025"},11,0,1,6]]},"id":"63802","type":"GridBox"},{"attributes":{"months":[0,6]},"id":"58437","type":"MonthsTicker"},{"attributes":{"data":{"x":{"__ndarray__":"AACAsOwHd0IAAEAWPwh3QgAAAHyRCHdCAADA4eMId0IAAIBHNgl3QgAAQK2ICXdCAAAAE9sJd0IAAMB4LQp3QgAAgN5/CndCAABARNIKd0IAAACqJAt3QgAAwA93C3dCAACAdckLd0IAAEDbGwx3QgAAAEFuDHdCAADApsAMd0IAAIAMEw13QgAAQHJlDXdCAAAA2LcNd0IAAMA9Cg53QgAAgKNcDndCAABACa8Od0IAAABvAQ93QgAAwNRTD3dCAACAOqYPd0IAAECg+A93QgAAAAZLEHdCAADAa50Qd0IAAIDR7xB3QgAAQDdCEXdCAAAAnZQRd0IAAMAC5xF3QgAAgGg5EndCAABAzosSd0IAAAA03hJ3QgAAwJkwE3dCAACA/4ITd0IAAEBl1RN3QgAAAMsnFHdCAADAMHoUd0IAAICWzBR3QgAAQPweFXdCAAAAYnEVd0IAAMDHwxV3QgAAgC0WFndCAABAk2gWd0IAAAD5uhZ3QgAAwF4NF3dCAACAxF8Xd0IAAEAqshd3QgAAAJAEGHdC
